import React, { Component } from 'react';
import { Row, Col } from 'react-bootstrap';


class Projects extends Component {

  render() {
    return (
        <Row className="justify-content-spaceAround text-center project-row">
            <Col lg={4} >
            1
            </Col>

            <Col lg={4}>
            2
            </Col>

            <Col lg={4}>
            3
            </Col>
        </Row>


    );
  }

}

export default Projects;
